import data
import coind_data

def hex_to_bytes(_hex):
    return ''.join(chr(int(_hex[i:i+2], 16)) for i in range(0, len(_hex), 2))

#TestForOneHashLink
_d = ''
_d_bytes = hex_to_bytes(_d)
# print(_d_bytes)
print(hex(coind_data.hash256(_d_bytes)))

_x = data.prefix_to_hash_link(_d_bytes)
print(hex(data.check_hash_link(_x, '')))
assert data.check_hash_link(_x, '') == coind_data.hash256(_d_bytes)
print(_x)
print([ord(x) for x in _x['state']])


#test_hash_link3
d = hex_to_bytes("")
d2 = hex_to_bytes("")
d3 = hex_to_bytes("")
x = data.prefix_to_hash_link(d + d2, d2)
assert data.check_hash_link(x, d3, d2) == coind_data.hash256(d + d2 + d3)
print(x)
print([ord(__x) for __x in x['state']])
print(hex(coind_data.hash256(d + d2 + d3)))